import React from 'react';

function JobPortal() {
  return (
    <div>
      <h2>Job Portal</h2>
      <ul>
        <li>DevOps Engineer at XYZ Company, Salary: 7-10 LPA, Experience: 3 yrs</li>
        <li>Cloud Engineer (Fresher), Salary: Up to 5 LPA</li>
      </ul>
    </div>
  );
}

export default JobPortal;
